import React from 'react';
import Category from './Category';

function Categories({name}) {
    return (
        <div>
            <h2>{name}</h2>
            <ul>
                <Category name="Отправленные"></Category>
                <Category name="Полученные"></Category>
            </ul>
        </div>
    )
}

export default Categories;
